import org.apache.spark._
import org.apache.spark.SparkContext._
import org.apache.log4j._

def procesarQuijote() {

    //RDD
    val input = sc.textFile("file:///Users/ricardo/Documents/quijote.txt")

    val palabras =  input.flatMap(linea => linea.split("\\W+"))

    val sumatorioPalabras = palabras.countByValue()

    //print resultado
    sumatorioPalabras.foreach(println)
}
//lanzar proceso
procesarQuijote()
